import React from "react"
import Sdata from "./Sdata";
import Card from "./Cards";

const Netflix = () =>
{
    return( <Card key = {Sdata[1].id}
        imgSrc={Sdata[1].img} 
        title={Sdata[1].title}
        sname={Sdata[1].name} 
        link={Sdata[1].link}/>
    );
}

export default Netflix;
